require('./tib-chrome.js');
const core = require('./tib-core.js');

class PuppeteerBrowser extends core['default'] {
  async _loadDependencies() {
    if (!core['default'].core) {
      core['default'].core = await this.loadDependency('puppeteer');
    }

    // call super after setting core
    super._loadDependencies();
  }
}

exports.default = PuppeteerBrowser;
